import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './index.css'; // Global styles
import MainPage from './MainPage'; // Main landing page
import NursePage from './NursePage'; // Page for nurse options
import SurveillanceForm from './SurveillanceForm'; // Form component for patient administration details
import JuniorDoctor from './JuniorDoctor'; // Junior Doctor page component
import SeniorDoctorPage from './SeniorDoctorPage'; // Senior Doctor page component
import SurgeryForm from './SurgeryForm'; // Patient surgery details form
import AntibioticForm from './AntibioticForm'; // Patient antibiotic details form
import MicrobiologyForm from './MicrobiologyForm'; // Patient microbiology details form

// Optional Not Found component for unknown routes
const NotFound = () => <h2>Page Not Found</h2>;

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        {/* Main Page Route */}
        <Route path="/" element={<MainPage />} />

        {/* Nurse Page with options to choose different forms */}
        <Route path="/nurse" element={<NursePage />} />

        {/* Form Routes */}
        <Route path="/surveillance-form" element={<SurveillanceForm />} />
        <Route path="/surgery-form" element={<SurgeryForm />} />
        <Route path="/antibiotic-form" element={<AntibioticForm />} />
        <Route path="/microbiology-form" element={<MicrobiologyForm />} />

        {/* Doctor Pages */}
        <Route path="/junior-doctor" element={<JuniorDoctor />} />
        <Route path="/senior-doctor" element={<SeniorDoctorPage />} />

        {/* Fallback Route for unknown pages */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  </React.StrictMode>
);
